import React from "react";
import Dropdown from 'react-dropdown';
import 'react-dropdown/style.css';

const dropDown = () => {
    return (
        <Dropdown options={[
            'one', 'two', 'three'
          ]}  placeholder="Select an option" />   
    );
  }
  export default dropDown;
